import styled from 'styled-components';

export const Container = styled.div`
    background-image: url(${props => props.image});
    background-size: 150%;
    background-color: #111;
    background-repeat: no-repeat;
    width: 100vw;
    height: 100vh;

    &:after {
        content: '';
        display: block;
        color: #111;
        width: 100vw;
        height: 100vh;
        z-index: 44;
    }
`
